 /// @custom:oz-upgrades-unsafe-allow constructor\\r\\n\\tconstructor() initializer {}\\r\\n\\r\\n\\tfunction initialize(string memory name_, string memory symbol_, address soulBEP20_) public initializer {\\r\\n\\t\\t__UUPSUpgradeable_init();\\r\\n\\t\\t__ERC721_init(name_, symbol_);\\r\\n\\t\\t__Ownable_init();\\r\\n\\r\\n        _soulBEP20 = ISoulBEP20(soulBEP20_);\\r\\n        _scale = 10 ** _soulBEP20.decimals();\\r\\n\\t}\\r\\n\\r\\n\\tfunction _authorizeUpgrade(address) internal override onlyOwner {}\\r\\n\\r\\n    /**\\r\\n     * @dev hold rewards\\r\\n\\t * add re-entrance guard\\r\\n     */\\r\\n    function _holdRewards(uint256 rewards) internal {\\r\\n        // add to pending rewards\\r\\n        _walletRewards[_msgSender()] = _walletRewards[_msgSender()].add(rewards);\\r\\n    }\\r\\n\\r\\n\\r\\n    function _safeMint(address to, uint256 tokenId) internal override {\\r\\n        super._safeMint(to, tokenId);\\r\\n\\r\\n        _sentzManager.incrementTokenId();\\r\\n    }\\r\\n\\r\\n    function _spawn(address receiver_, CryptoGodzStructs.Element element) internal {\\r\\n        uint256 nextTokenId = _sentzManager.getNextTokenId();\\r\\n        _safeMint(receiver_, nextTokenId);\\r\\n\\r\\n        _sentz[nextTokenId] = CryptoGodzStructs.CryptoSentz({\\r\\n            level: 1,\\r\\n            spirit: _sentzManager.getBaseSpiritCount(),\\r\\n            element: element,\\r\\n            class: CryptoGodzStructs.Class.BASIC,\\r\\n            transmuted: false\\r\\n        });\\r\\n\\r\\n        emit Spawn(nextTokenId, receiver_);\\r\\n    }\\r\\n\\r\\n    function _takeTransmuteFee() internal {\\r\\n        // get transmute fee\\r\\n        (uint256 fee_05, uint256 fee_95) = _sentzManager.getDistributedTransmuteFee();\\r\\n\\r\\n        // burn 95% transmute fee\\r\\n        _soulBEP20.safeTransferFrom(_msgSender(), BURN_ADDRESS, fee_95.mul(_scale));\\r\\n\\r\\n        // take 5% transmute fee\\r\\n        _soulBEP20.safeTransferFrom(_msgSender(), address(this), fee_05.mul(_scale));\\r\\n    }\\r\\n\\r\\n    function _tokenOrder(uint256 tokenId_, bool sell_, uint256 price_) internal {\\r\\n        if (sell_) {\\r\\n            transferFrom(_msgSender(), address(this), tokenId_);\\r\\n\\r\\n            tokenSales.add(tokenId_);\\r\\n\\r\\n            sellerTokens[_msgSender()].add(tokenId_);\\r\\n\\r\\n            markets[tokenId_] = CryptoGodzStructs.ItemSale({\\r\\n                tokenId: tokenId_,\\r\\n                price: price_,\\r\\n                owner: _msgSender()\\r\\n            });\\r\\n        } else {\\r\\n            CryptoGodzStructs.ItemSale storage itemSale = markets[tokenId_];\\r\\n\\r\\n            transferFrom(address(this), _msgSender(), tokenId_);\\r\\n\\r\\n            tokenSales.remove(tokenId_);\\r\\n\\r\\n            sellerTokens[itemSale.owner].remove(tokenId_);\\r\\n\\r\\n            markets[tokenId_] = CryptoGodzStructs.ItemSale({\\r\\n                tokenId: 0,\\r\\n                price: 0,\\r\\n                owner: address(0)\\r\\n            });\\r\\n        }\\r\\n    }\\r\\n\\r\\n    function _getSale(uint256 tokenId_) internal view returns (CryptoGodzStructs.ItemSale memory) {\\r\\n        if (tokenSales.contains(tokenId_))\\r\\n            return markets[tokenId_];\\r\\n\\r\\n        return CryptoGodzStructs.ItemSale({tokenId: 0, owner: address(0), price: 0});\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Set Manager\\r\\n\\t * add re-entrance guard\\r\\n     */\\r\\n\\tfunction setManager(address sentzManager_) external override onlyOwner {\\r\\n        _sentzManager = ISentzNFTManager(sentzManager_);\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Spawn\\r\\n\\t * add re-entrance guard\\r\\n     */\\r\\n    function spawn(CryptoGodzStructs.Element[] memory elements) external override {\\r\\n        require(elements.length > 0, \\"spawn: require elements\\");\\r\\n\\r\\n\\t\\t// burn token\\r\\n\\t\\tuint256 spawnFee = getSpawnFee().mul(elements.length);\\r\\n        spawnFee = spawnFee.mul(_scale);\\r\\n\\r\\n        _soulBEP20.safeTransferFrom(_msgSender(), BURN_ADDRESS, spawnFee);\\r\\n\\r\\n        // spawn\\r\\n        for (uint256 index = 0; index < elements.length; index++) {\\r\\n            _spawn(_msgSender(), elements[index]);\\r\\n        }\\r\\n\\r\\n        // todo: emit spawn event\\r\\n    }\\r\\n\\r\\n    function getCampaignRewards(uint256 tokenId_) external view override returns (uint256) {\\r\\n        return _sentzManager.getCampaignRewards(getSentzLevel(tokenId_));\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Fight campaign and assign rewards to winner\\r\\n\\t * add re-entrance guard\\r\\n     */\\r\\n\\tfunction fightCampaign(uint256 tokenId_) external override {\\r\\n\\t\\trequire(tokenId_ != uint256(0) , \\"no token id\\");\\r\\n\\t\\trequire(ownerOf(tokenId_) == _msgSender() , \\"not owner\\");\\r\\n        \\r\\n        // take 1 spirit\\r\\n        CryptoGodzStructs.CryptoSentz storage sentz = _sentz[tokenId_];\\r\\n\\t\\trequire(sentz.spirit > 0 , \\"spirit less sentz\\");\\r\\n        sentz.spirit = sentz.spirit.sub(1);\\r\\n\\r\\n        // calculate rewards\\r\\n\\t\\tuint256 rewards = _sentzManager.getCampaignRewards(getSentzLevel(tokenId_));\\r\\n\\r\\n        // save fight history\\r\\n        uint256 fightId = _sentzManager.getNextFightId();\\r\\n        _fightHistory[fightId] = CryptoGodzStructs.FightHistory({\\r\\n            player: _msgSender(),\\r\\n            tokenId: tokenId_,\\r\\n            rewards: rewards,\\r\\n            date: block.timestamp,\\r\\n            winrate: 10,\\r\\n            hasWon: true,\\r\\n            isMinted: false,\\r\\n            enemyElement: CryptoGodzStructs.Element(0),\\r\\n            enemyClass: CryptoGodzStructs.Class(0)\\r\\n        });\\r\\n        _playerFights[_msgSender()].add(fightId);\\r\\n\\r\\n        // hold reward\\r\\n\\t\\t_holdRewards(rewards);\\r\\n\\r\\n        _sentzManager.incrementFightId();\\r\\n\\r\\n        // emit fight campaign event\\r\\n        emit FightCampaign(fightId, _msgSender(), rewards);\\r\\n\\t}\\r\\n\\r\\n    /**\\r\\n     * @dev Find duel\\r\\n\\t * add re-entrance guard\\r\\n     */\\r\\n\\tfunction findDuel(uint256 tokenId_) external override {\\r\\n\\t\\trequire(tokenId_ != uint256(0) , \\"no token id\\");\\r\\n\\t\\trequire(ownerOf(tokenId_) == _msgSender() , \\"not owner\\");\\r\\n\\r\\n        // take 1 spirit\\r\\n        CryptoGodzStructs.CryptoSentz storage sentz = _sentz[tokenId_];\\r\\n\\t\\trequire(sentz.spirit > 0 , \\"spirit less sentz\\");\\r\\n        sentz.spirit = sentz.spirit.sub(1);\\r\\n\\r\\n        CryptoGodzStructs.Element enemyElement = _sentzManager.getEnemyElement();\\r\\n        CryptoGodzStructs.Class enemyClass = _sentzManager.getEnemyClass();\\r\\n        \\r\\n        // get base winrate\\r\\n        uint256 winrate = _sentzManager.getBaseWinrate(sentz.element, enemyElement);\\r\\n\\r\\n        // get bonus winrate\\r\\n        (uint256 ownBonus, uint256 enemyBonus) = _sentzManager.getBonusWinrate(sentz.class, enemyClass);\\r\\n        winrate = winrate.add(ownBonus).sub(enemyBonus);\\r\\n\\r\\n        // get duel rewards\\r\\n\\t\\tuint256 rewards = _sentzManager.getDuelRewards(sentz.level);\\r\\n\\r\\n        // create duel record\\r\\n        uint256 duelId = _sentzManager.getNextFightId();\\r\\n        _fightHistory[duelId] = CryptoGodzStructs.FightHistory({\\r\\n            player: _msgSender(),\\r\\n            tokenId: tokenId_,\\r\\n            rewards: rewards,\\r\\n            date: block.timestamp,\\r\\n            winrate: winrate,\\r\\n            hasWon: false,\\r\\n            isMinted: false,\\r\\n            enemyElement: enemyElement,\\r\\n            enemyClass: enemyClass\\r\\n        });\\r\\n\\r\\n        _sentzManager.incrementFightId();\\r\\n\\r\\n        // emit find duel event\\r\\n        emit FindDuel(duelId, _msgSender());\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Fight duel and assign rewards to winner\\r\\n\\t * add re-entrance guard\\r\\n     */\\r\\n\\tfunction fightDuel(uint256 duelId_) external override {\\r\\n        CryptoGodzStructs.FightHistory storage duel = _fightHistory[duelId_];\\r\\n        \\r\\n\\t\\tbool win = _sentzManager.startDuel(duel.winrate);\\r\\n        \\r\\n        // update duel history\\r\\n        duel.hasWon = win;\\r\\n        _playerFights[_msgSender()].add(duelId_);\\r\\n\\r\\n        // hold reward\\r\\n        if (win) _holdRewards(duel.rewards);\\r\\n\\r\\n        // emit fight duel event\\r\\n        emit FightDuel(duelId_, _msgSender(), win);\\r\\n\\t}\\r\\n\\r\\n    /**\\r\\n     * @dev Get Player Fights\\r\\n     */\\r\\n\\tfunction getPlayerFights() external view override returns (uint256) {\\r\\n        return _playerFights[_msgSender()].length();\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Get Single Player Fight\\r\\n     */\\r\\n\\tfunction getFightHistory(uint256 fightId_) external view override returns (CryptoGodzStructs.FightHistory memory) {\\r\\n        return _fightHistory[fightId_];\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Get fight rewards from fight history object\\r\\n\\t * add re-entrance guard\\r\\n     */\\r\\n    function getFightRewards(address recipient_, uint256 fightId_) external override returns (uint256) {\\r\\n        require(recipient_ != address(0), \\"require: recipient address not 0\\");\\r\\n        require(fightId_ != 0, \\"require: fight id not 0\\");\\r\\n\\r\\n        CryptoGodzStructs.FightHistory storage fightHistory = _fightHistory[fightId_];\\r\\n\\r\\n        require(fightHistory.player == recipient_, \\"require: not own fight\\");\\r\\n        require(fightHistory.rewards > 0, \\"require: rewards > 0\\");\\r\\n        require(fightHistory.isMinted == false, \\"require: minted is false\\");\\r\\n\\r\\n        fightHistory.isMinted = true;\\r\\n\\r\\n        // emit mint fight reward\\r\\n\\r\\n        return fightHistory.rewards;\\r\\n    }\\r\\n    \\r\\n    /**\\r\\n     * @dev Transmute sentz into a fusion stone\\r\\n\\t * add re-entrance guard\\r\\n     */\\r\\n    function transmute(address owner_, uint256 tokenId_) external override {\\r\\n        require(ownerOf(tokenId_) == owner_, \\"require: not owner\\");\\r\\n\\r\\n        // take trasmute fee\\r\\n        _takeTransmuteFee();\\r\\n        \\r\\n        // upgrade sentz level and reset spirit\\r\\n        CryptoGodzStructs.CryptoSentz storage sentz = _sentz[tokenId_];\\r\\n        sentz.transmuted = true;\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Fusion\\r\\n\\t * add re-entrance guard\\r\\n     */\\r\\n    function fusion(address owner_, uint256 tokenId_, uint256 transmutedTokenId_) external override {\\r\\n        require(ownerOf(tokenId_) == owner_, \\"require: not owner\\");\\r\\n        require(ownerOf(transmutedTokenId_) == owner_, \\"require: not owner\\");\\r\\n        \\r\\n        CryptoGodzStructs.CryptoSentz storage sentz = _sentz[tokenId_];\\r\\n        CryptoGodzStructs.CryptoSentz memory fusionStone = _sentz[transmutedTokenId_];\\r\\n        \\r\\n        require(sentz.element == fusionStone.element, \\"require: same element\\");\\r\\n\\r\\n        // upgrade sentz level\\r\\n        sentz.level = sentz.level.add(fusionStone.level);\\r\\n        \\r\\n        // reset spirit\\r\\n        sentz.spirit = _sentzManager.getBaseSpiritCount();\\r\\n        \\r\\n        // burn transmuted sentz\\r\\n        _burn(transmutedTokenId_);\\r\\n\\r\\n        // todo: emit evolve event\\r\\n    }\\r\\n\\r\\n    // marketplace\\r\\n    function placeSellOrder(uint256 tokenId_, uint256 price_) external override {\\r\\n        require(ownerOf(tokenId_) == _msgSender(), \\"not own\\");\\r\\n        require(price_ > 0, \\"nothing is free\\");\\r\\n\\r\\n        _tokenOrder(tokenId_, true, price_);\\r\\n\\r\\n        emit PlaceSellOrder(tokenId_, _msgSender(), price_);\\r\\n    }\\r\\n\\r\\n    function cancelSellOrder(uint256 tokenId_) external override {\\r\\n        require(tokenSales.contains(tokenId_), \\"not sale\\");\\r\\n        CryptoGodzStructs.ItemSale memory itemSale = _getSale(tokenId_);\\r\\n        require(itemSale.owner == _msgSender(), \\"not own\\");\\r\\n\\r\\n        _tokenOrder(tokenId_, false, 0);\\r\\n\\r\\n        emit CancelSellOrder(tokenId_, _msgSender());\\r\\n    }\\r\\n\\r\\n    function updatePrice(uint256 tokenId_, uint256 price_) external override {\\r\\n        require(price_ > 0, \\"nothing is free\\");\\r\\n        require(tokenSales.contains(tokenId_), \\"not for sale\\");\\r\\n        CryptoGodzStructs.ItemSale storage itemSale = markets[tokenId_];\\r\\n        require(itemSale.owner == _msgSender(), \\"not own\\");\\r\\n\\r\\n        itemSale.price = price_;\\r\\n\\r\\n        emit UpdatePrice(tokenId_, _msgSender(), price_);\\r\\n    }\\r\\n\\r\\n    function fillBuyOrder(uint256 tokenId_) external override {\\r\\n        require(tokenSales.contains(tokenId_), \\"not sale\\");\\r\\n\\r\\n        CryptoGodzStructs.ItemSale memory itemSale = _getSale(tokenId_);\\r\\n\\r\\n        _soulBEP20.safeTransferFrom(\\r\\n            _msgSender(),\\r\\n            itemSale.owner,\\r\\n            itemSale.price.mul(_scale)\\r\\n        );\\r\\n\\r\\n        _tokenOrder(tokenId_, false, 0);\\r\\n        emit FillBuyOrder(tokenId_, _msgSender());\\r\\n    }\\r\\n\\r\\n    function getSentz(uint256 tokenId_) external view override returns (CryptoGodzStructs.CryptoSentz memory) {\\r\\n        return _sentz[tokenId_];\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Claim Rewards\\r\\n\\t * add re-entrance guard\\r\\n     */\\r\\n\\tfunction claimRewards() external override {\\r\\n\\t\\tuint256 rewards = getPendingRewards();\\r\\n\\r\\n        uint256 walletUnlockDate = _walletUnlockDate[_msgSender()];\\r\\n\\r\\n        if (walletUnlockDate != 0) {\\r\\n            require(block.timestamp > walletUnlockDate, \\"Rewards are still locked\\");\\r\\n        }\\r\\n        \\r\\n        require(rewards > 0, \\"No rewards to claim\\");\\r\\n        _walletRewards[_msgSender()] = 0;\\r\\n        \\r\\n        // transfer rewards from this address to player address\\r\\n        _soulBEP20.safeTransferFrom(\\r\\n            address(this),\\r\\n            _msgSender(),\\r\\n            rewards.mul(_scale)\\r\\n        );\\r\\n\\r\\n        // set next unlock date + 5 days\\r\\n        _walletUnlockDate[_msgSender()] = uint256(block.timestamp).add(432000);\\r\\n\\t}\\r\\n\\r\\n    function getPendingRewards() public view override returns (uint256) {\\r\\n        return _walletRewards[_msgSender()];\\r\\n    }\\r\\n\\r\\n    function getSentzLevel(uint256 tokenId_) public view override returns (uint256) {\\r\\n        return _sentz[tokenId_].level;\\r\\n    }\\r\\n\\r\\n    function getSpawnFee() public view override returns (uint256) {\\r\\n        return _sentzManager.getSpawnFee();\\r\\n    }\\r\\n\\r\\n    function getTransmuteFee() public view override returns (uint256) {\\r\\n        return _sentzManager.getTransmuteFee();\\r\\n    }\\r\\n\\r\\n    function marketsSize() public view override returns (uint256) {\\r\\n        return tokenSales.length();\\r\\n    }\\r\\n\\r\\n    function orders(address seller_) public view override returns (uint256) {\\r\\n        return sellerTokens[seller_].length();\\r\\n    }\\r\\n\\r\\n    function tokenSaleByIndex(uint256 index_) public view override returns (uint256) {\\r\\n        return tokenSales.at(index_);\\r\\n    }\\r\\n\\r\\n    function tokenSaleOfOwnerByIndex(address seller_, uint256 index_) public view override returns (uint256)\\r\\n    {\\r\\n        return sellerTokens[seller_].at(index_);\\r\\n    }\\r\\n}","sourcePath":"C:\\\\Users\\\\User\\\\OneDrive\\\\Desktop\\\\workspace\\\\CryptoGodz\\\\smart-contracts\\\\contracts\\\\SentzNFT\\\\SentzNFT.sol","ast":{"absolutePath":"project:/contracts/SentzNFT/SentzNFT.sol","exportedSymbols":{"AddressUpgradeable":[2338],"BURN_ADDRESS":[4103],"ContextUpgradeable":[2382],"CryptoGodzStructs"